import React from 'react';
const App = () => {
 const productList = [
   { id: 1, productName: 'Product 1', quantity: 2, price: 10.99 },
   { id: 2, productName: 'Product 2', quantity: 3, price: 19.99 },
   { id: 3, productName: 'Product 3', quantity: 1, price: 7.99 },
 ];
 return (
<div>
<h1>Product List</h1>
<table border="1">
<thead>
<tr>
<th>ID</th>
<th>Product Name</th>
<th>Quantity</th>
<th>Price</th>
</tr>
</thead>
<tbody>
         {productList.map((product) => (
<tr key={product.id}>
<td>{product.id}</td>
<td>{product.productName}</td>
<td>{product.quantity}</td>
<td>{product.price}</td>
</tr>
         ))}
</tbody>
</table>
</div>
 );
};
export default 'App';
